import React from "react";
import Service from "./Service";

const Ford =()=>{
    var cars=[];
    var x=setInterval(function(){
        if(cars.length>0){
            clearInterval(x);
            {cars.map((item) => {
                document.getElementById("cars-container").innerHTML+="<div><span>"+item[0]+", </span>";
                document.getElementById("cars-container").innerHTML+="<span>"+item[1]+", </span>";
                document.getElementById("cars-container").innerHTML+="<span>Rs "+item[2]+", </span>";
                document.getElementById("cars-container").innerHTML+="<span>"+item[3]+", </span>";
                document.getElementById("cars-container").innerHTML+="<span>"+item[4]+", </span>";
                document.getElementById("cars-container").innerHTML+="<span>"+item[5]+", </span>";
                document.getElementById("cars-container").innerHTML+="<span>"+item[6]+", </span>";
                document.getElementById("cars-container").innerHTML+="<span>"+item[7]+", </span>";
                document.getElementById("cars-container").innerHTML+="<span>"+item[8]+", </span>";
                document.getElementById("cars-container").innerHTML+="<span>"+item[9]+"</span></div>";
            })}
        }},500
        );
    Service.cars().then((resp) =>{
        if (resp.data.response !== 0 && resp.data.response !== undefined && resp.data.response !== null) {
            const values=JSON.parse(resp.data.response);
            // eslint-disable-next-line
            const carss=values.map((carss)=>{
                cars.push(carss);
                return carss;
            });
        }else{
            alert("Error");
        }
    }); 
    return(
        <>
        <div id="cars-container"></div>
        </>
        );
};

export default Ford;
